import { useState, memo, useEffect } from "react"
import PartnerHomeNoneService from "../PartnerHomeNoneService"
import PartnerHomeHadService from "../PartnerHomeHadService"
import axios from "axios"
import { API_GET_SERVICE_BY_EMAIL_ACCOUNT } from "../../API"
import './PartnerHome.scss'

function PartnerHome() {
    const [services, setServices] = useState([])
    const [isGetDataDone, setIsGetDataDone] = useState(false)
    const email = sessionStorage.getItem('email')

    useEffect(() => {
        axios.get(API_GET_SERVICE_BY_EMAIL_ACCOUNT, {
            params: { emailPartner: email }
        }).then((response) => {
            setIsGetDataDone(true)
            console.log(response)
            setServices(response.data.data)
        })
    }, [])

    return (<div className='container home-main'>
        {services.length > 0 ? <PartnerHomeHadService services={services} /> : <PartnerHomeNoneService />}
    </div>)
}

export default memo(PartnerHome)
